           <h1 className="mt-0 font-medium">לא מצאנו את מה שחיפשת</h1>
           <p className="mt-1 mb-1 font-small">כדאי לבדוק אם הכתובת שהזנת נכונה</p>
           <p className="font-small">נסה לחפש שוב או המשך<Nav.Link href="/" class>לדף הבית שלנו</Nav.Link></p>
                                    
            
        </div>

        )
    }
}

export default Error
